[{"location":"contents/","page":"Contents","title":"Contents","text":"Depth = 2","category":"page"},{"location":"library/#library","page":"Library Functions","title":"Library Functions","text":"","category":"section"},{"location":"library/","page":"Library Functions","title":"Library Functions","text":"","category":"page"},{"location":"library/#TODO-add-functions","page":"Library Functions","title":"TODO add functions","text":"","category":"section"},{"location":"related/#Related-Publications","page":"Related Publication","title":"Related Publications","text":"","category":"section"},{"location":"related/","page":"Related Publication","title":"Related Publication","text":"Thummerer T, Kircher J and Mikelsons L: Neural FMU: Towards structual integration of FMUs into neural networks (Preprint, accepted 14th International Modelica Conference) pdf|DOI","category":"page"},{"location":"related/","page":"Related Publication","title":"Related Publication","text":"Thummerer T, Tintenherr J, Mikelsons L: Hybrid modeling of the human cardiovascular system using NeuralFMUs (Preprint, accepted 10th International Conference on Mathematical Modeling in Physical Sciences) pdf|DOI","category":"page"},{"location":"overview/#Examples-Overview","page":"Examples","title":"Examples - Overview","text":"","category":"section"},{"location":"overview/","page":"Examples","title":"Examples","text":"To see the handling with FMUs in Julia, you can have a look at the examples from the FMI.jl package.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"(Image: FMI.jl Logo)","category":"page"},{"location":"#FMIImport.jl","page":"Introduction","title":"FMIImport.jl","text":"","category":"section"},{"location":"#What-is-FMIImport.jl?","page":"Introduction","title":"What is FMIImport.jl?","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"FMIImport.jl implements the import functionalities of the FMI-standard (fmi-standard.org) for the Julia programming language.  FMIImport.jl provides the foundation for the Julia packages FMI.jl and FMIFlux.jl.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"(Image: Dev Docs)  (Image: Run Tests) (Image: Build Docs) (Image: Coverage) (Image: ColPrac: Contributor's Guide on Collaborative Practices for Community Packages)","category":"page"},{"location":"#How-can-I-use-FMIImport.jl?","page":"Introduction","title":"How can I use FMIImport.jl?","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"FMIImport.jl is part of FMI.jl. However, if you only need the import functionality without anything around and want to keep the dependencies as small as possible, FMIImport.jl might be the right way to go. You can install it via:","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Open a Julia-REPL, activate your preferred environment.\nGoto Package-Manager (if not already), install FMIImport.jl.  ```julia  julia> ]\n(@v1.6) pkg> add FMIImport  ```\nIf you want to check that everything works correctly, you can run the tests bundled with FMIImport.jl:  ```julia  julia> using Pkg\njulia> Pkg.test(\"FMIImport\")  ```\nAdditionally, you can check the version of FMIImport.jl that you have installed with the status command.  julia  julia> ]  (@v1.6) pkg> status FMIImport\nHave a look inside the examples folder in the examples branch or the examples section of the documentation of the FMI.jl package. All examples are available as Julia-Script (.jl), Jupyter-Notebook (.ipynb) and Markdown (.md).","category":"page"},{"location":"#What-FMI.jl-Library-should-I-use?","page":"Introduction","title":"What FMI.jl-Library should I use?","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"(Image: FMI.jl Family) To keep dependencies nice and clean, the original package FMI.jl had been split into new packages:","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"FMI.jl: High level loading, manipulating, saving or building entire FMUs from scratch\nFMIImport.jl: Importing FMUs into Julia\nFMIExport.jl: Exporting stand-alone FMUs from Julia Code\nFMICore.jl: C-code wrapper for the FMI-standard\nFMIBuild.jl: Compiler/Compilation dependencies for FMIExport.jl\nFMIFlux.jl: Machine Learning with FMUs (differentiation over FMUs)\nFMIZoo.jl: A collection of testing and example FMUs","category":"page"},{"location":"#What-Platforms-are-supported?","page":"Introduction","title":"What Platforms are supported?","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"FMIImport.jl is tested (and testing) under Julia Versions 1.6.5 LTS and latest on Windows latest and Ubuntu latest. x64 architectures are tested. Mac and x86-architectures might work, but are not tested.","category":"page"},{"location":"#How-to-cite?","page":"Introduction","title":"How to cite?","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"Tobias Thummerer, Lars Mikelsons and Josef Kircher. 2021. NeuralFMU: towards structural integration of FMUs into neural networks. Martin Sjölund, Lena Buffoni, Adrian Pop and Lennart Ochel (Ed.). Proceedings of 14th Modelica Conference 2021, Linköping, Sweden, September 20-24, 2021. Linköping University Electronic Press, Linköping (Linköping Electronic Conference Proceedings ; 181), 297-306. DOI: 10.3384/ecp21181297","category":"page"},{"location":"#Related-publications","page":"Introduction","title":"Related publications","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"Tobias Thummerer, Johannes Tintenherr, Lars Mikelsons 2021 Hybrid modeling of the human cardiovascular system using NeuralFMUs Journal of Physics: Conference Series 2090, 1, 012155. DOI: 10.1088/1742-6596/2090/1/012155","category":"page"}]
